(22, 'Anonymous', 'support@techtravellers.com', 'Chandipur Sea beach', '<p>Chandipur is a small sea resort in Baleswar District, Odisha. This sea beach is one of the best weekend destinations as the place is very calm and quite unlike the Digha and Puri beach. The sunset and sunrise is the most amazing sight. The uniqueness of this beach is that the water recedes up to 5 kilometers during the ebb tide. Unlike the other beaches, the water is murky and cold. It feels great to walk on the cold soft mud-like sand. The horseshoe crab is also found here on the beach towards Mirzapur, the nearby fishing market, and the community at the confluence of the Budhabalanga River(Balaramgadi). It is also a very suitable picnic spot. There are many resorts situated nearby. The most popular among them is &ldquo;Panthanivas&rdquo; which is an Odisha Tourism\'s guest house.<br />In summer the temperature is 25-40 degrees Celsius, but in winter it\'s 17-26 degree Celsius. Nov-Mar is the suitable time for traveling here.</p>\n<p>Chandipur can be reached by traveling up to Baleswar by rail or road and then thereafter catching a bus, auto or taxi. Road access to Baleswar is via National Highway 16 (NH-16). Chandipur sea&nbsp;beach is 16 km from Balasore railway station.</p>\n<p><strong>Nearby places:</strong> The most popular locations near Chandipur are Devkund Waterfalls, Panchalinegeswar, Khirachora Gopinath temple, Chandipur Beach, Emami Jagannath temple, &amp; Nilgiri Jagannath temple.</p>', '::1', '2018-07-21 21:56:52', '2018-03-21'),
(23, 'Anonymous', 'support@techtravellers.com', 'A Story of how Murshidabad was named', '<p style=\"font-weight: 400;\"><strong>Murshidabad</strong>&nbsp;was once the most important city of Bengal until Nawab Siraj-Ud-Daulah lost it out to the British Empire after being betrayed by Mir-Jafar. In 1757 and Robert Clive won the vital battle of Plassey.&nbsp;So let&rsquo;s begin a short story behindMuksudabad and how it is changed to&nbsp;<strong>Murshidabad.</strong></p>\n<p style=\"font-weight: 400;\">In the late 17<sup>th</sup>&nbsp;century, one deccan brahmin (fall under the Pancha Dravida&nbsp;Brahmin&nbsp;classification of the brahmin&nbsp;community in India) was cursing himself. Due to poverty, he was forced to sell himself into slavery. He was bought by one Haji Shafi Isfahani, who was a Persian Merchant from Iran. The merchant gave him an education and renamed him to Mirza Hadi after converting him to Islam. Returning to India, Mirza Hadi joined the service of the Mughals. His active role in Aurangzeb&rsquo;s warfare in the Deccan gave him the title of &ldquo;<strong>Kartalab Khan</strong>&rdquo;. When there was a need for Diwan in Bengal at Dacca, Kartalab Khan was emperor&rsquo;s involuntary choice.</p>\n<p style=\"font-weight: 400;\">Kartalab Khan was efficient as an administrator, he went into a confrontation with Azim-ush-Shan, the grandson of the emperor. In the year 1703, Kartalab Khan relocated his office from Dacca to Muksudabad on the banks of Bhagirathi River.</p>\n<p style=\"font-weight: 400;\">He was now Aurangzeb&rsquo;s most ideal brigadier as he generated the maximum revenue. In 1704, Aurangzeb honored him with the title of&nbsp;<strong>Murshid Quli Khan</strong>. He went on to become the first independent Nawab of Bengal and Orissa. Instantaneously he changed the city&rsquo;s name to&nbsp;<strong>Murshidabad.</strong></p>', '::1', '2018-07-21 22:10:20', '2018-02-21'),
(24, 'Anonymous', 'support@techtravellers.com', 'Ratha Yatra', '<p><strong>Ratha Yatra:<br /></strong></p>\r\n<p>Ratha Yatra&nbsp;is one of the biggest and widely-celebrated festivals of India wherein millions of devotees arrive at the Jagannath Temple at Puri. Ratha Yatra also referred to as Rathayatra, Rathajatra or Chariot festival(chariot which means Rath or carriage) is any public procession in a chariot. Rathayatra which is famous in Odisha, Jharkhand and other East Indian states, particularly the Odia festival. Ratha Yatra, also celebrated internationally in countries like Dublin, Moscow and New York, is to celebrate Jagannath\'s visit to Gundicha Temple through Mausi Maa Temple in Puri.</p>\r\n<p>The Jagannath temple in Puri was built approximately 12th Century AD by King Chodaganga of the Eastern Ganga dynasty. Puri Jagannath Temple is the one of the DHAM within CHAR DHAM. Other three being: Rameshwar in South, Dwarka in West and Badrinath in the Himalayas</p>\r\n<p style=\"font-weight: 400;\"><strong>&nbsp;</strong></p>\r\n<p style=\"font-weight: 400;\"><strong>The history behind the Rath Jatra:</strong></p>\r\n<p>There are many stories regarding celebrate this festival but the most fabulous story which has been passed on from mouth to mouth tells what happened after the creation of Lord Krishna\'s mortal body.&nbsp;</p>\r\n<p>Shri Krishna was cremated in Dwarka. To overcome with sorrow of beloved brother Krishna, Balaram dashed into the ocean with Shri Krishna&rsquo;s partially cremated body. Subhadra too followed both the brothers.&nbsp;</p>\r\n<p>At the same time, on the eastern shore of India, King of Puri -Indradyumna had a dreamt about the Lord&rsquo;s body would float up to the shores of Puri. He should build a huge Temple in the city and make wooden idols of Shri Krishna, Balaram, and Subhadra. The bones or Asthi of Lord Krishna&rsquo;s body should be placed in the hollow in the back of the wooden idol.</p>\r\n<p>The dream came true. He found the splinters of bone (asthi) and took them. But the question is who would crave the Statues.&nbsp;</p>\r\n<p>God of architect (Vishwakarma) arrived as an old carpenter, he made it clear that while carving the statues nobody should disturb him, and in case anybody did, he would vanish leaving the work unfinished &nbsp;and started making the idols. After few months King Indradyumna become impatience and opened the door of Vishwakarma&rsquo;s room. Lord Vishwakarma vanished instantly as he had agreed. The King then placed incomplete idols in the temple.&nbsp;</p>\r\n<p>The statues are changed every 12 years , the new ones being incomplete also.</p>\r\n<p><strong>Chariots of the deities:</strong></p>\r\n<p>The chariots of the deities are newly built every year. Jagannath\'s chariot is called Nandighosa, the chariot of Balabhadra is called Taladhwaja and that of Subhadra is called Dwarpadalana.</p>\r\n<p>The total number of wheels on Lord Jagannath\'s chariot are 16, Lord Balabhadra\'s chariot are 14 and Subhadra\'s chariot are 12.</p>', '::1', '2018-07-21 22:30:40', '2018-07-21'),
(25, 'Anonymous', 'support@techtravellers.com', 'Talsari', '<div>Talasari Beach is a beach in the Baleswar district of Odisha, India. It lies on the north-eastern coast of India.</div>\n<div>The beach is situated at&nbsp;<strong>West Bengal &amp; Orissa</strong>&nbsp;border. It is very calm &amp; quiet beaches. One has taken the service of a local boat to reach the beach in the time of full tide. The beach is also famous for red crabs which are visible at midday. Overall the calmness &amp; solitude of the beach is a special attraction for the couple who need privacy.</div>\n<div><strong>The Talsari beach is popular for its red crabs.&nbsp;</strong>The beach. Is very very beautiful, free from crowd and chaos. Ideal place for a nature lover.</div>\n<div>The place has vast stretches of green paddy fields, numerous rivers, blue hills and extensive beaches. The beach with its tall coconut trees, palm trees, and casuarina make for a beautiful sight. Udaipur beach is the last beach on this stretch.</div>\n<div>The stream plays hide-and-seek with people. When the stream is brimming, one can only reach the main beach with the help of a boat. But at other times, one can walk across the dry riverbed. The place is fairly windy.</div>\n<div>Talasari is one of the less exploited Odisha beaches. The Talsari beach is not as frequently visited by the people as the other beaches of Odisha. The waters of the sea at Talsari beach are not turbulent but calm and peaceful.</div>\n<div><strong>Places to see in Talasari:</strong>&nbsp;Talasari is a sea beach where River Subarnarekha meets the Bay of Bengal. This long and deserted sea beach stretching for miles is a treat to the eyes. The famous Chandaneshwar temple is just a few minutes from Talasari.</div>\n<div>&nbsp;</div>\n<div><strong>How to reach :</strong></div>\n<div>In Odisha, Talasari is 36 km s from Jaleshwar, is the nearest railway station and Kolkata is the nearest airport and is 180&nbsp; km from Talsari. It\'s also well connected to Baleswar. However, from West Bengal side, Talsari is only 8&ndash;10 km away from Digha.</div>\n<div>There are two ways to reach this awesome place. Firstly you can take a cab/auto rickshaw/toto for hire which takes around 250/- - 300/- to get you there.</div>', '::1', '2018-07-21 22:36:39', '2018-04-21'),
(26, 'Anonymous', 'support@techtravellers.com', 'Malshejghat Maharashtra', '<div>125 Km away from the film city of Mumbai you can find another gateway to heaven, Malshejghat. This hill station is the part of Sahyadri ranges and during monsoon enriched with beautiful waterfalls. When the rains visit Malshej Ghat, the birds arrive here in huge numbers, with birds like AlpineSwift, WhistlingThrush, Quail,&nbsp; purple moorhen, and&nbsp; PiedCrustedCuckoo making a frequent visit. The&nbsp; Flamingos are known to come here during the monsoon all the way from Europe. The place is also a perfect destination for trekking, hiking rock-climbing, and birdwatching. Long drive to Malshej ghat with a picturesque view of the valleys is the reason for us to cherry pick the place among others.&nbsp;</div>\n<div>Once you are here you should try to Trek Up to Harishchandragad Fort (1.4 km altitude) or even try a Rock Climbing at Ajoba Hill Fort. And if you just want to sit back and relax just watch the Enjoy the Cascading Waterfalls.&nbsp;</div>\n<div>A must visit the place is the historic Shivneri Fort, which is about 40 kilometers from Malshej Ghat. This historical fort was the birthplace of Chhatrapati Shivaji Maharaj, the legend behind the rise of Maratha Empire. A tip from the tech traveler to try some local fruits while you are traveling by road, especially mulberry. If you need more information related to the location please write us at support@techtravellers.com</div>\n<div><strong>How to Reach Malshej Ghat from Pune by Road (118KM):</strong></div>\n<div>To reach Malshej Ghat from Pune take a&nbsp; Pune-Nashik highway and head towards&nbsp; Chakan &ndash;&nbsp; Rajgurunagar &ndash;&nbsp; Peth &ndash;&nbsp; Manchar &ndash;&nbsp; Narayangaon &ndash;&nbsp; Junnar and reach Malshej Ghat via&nbsp; Khubi.</div>\n<div><strong>How to Reach Malshej Ghat from Mumbai (126KM):</strong></div>\n<div>From Mumbai to reach Malshej Ghat use Eastern Express Highway to reach&nbsp; Thane. From Thane head towards&nbsp; Kalyan. From&nbsp; Bhiwandi Bypass Toll reach Kalyan Phata. Head towards &ndash;&nbsp; Murbad &ndash;&nbsp; Shivale &ndash;&nbsp; Saralgaon &ndash;&nbsp; Kasgaon &ndash; Tokawade to reach Malshej Ghat.</div>\n<div><strong>Nearest Airport:</strong>&nbsp;Chhatrapati Shivaji International Airport, Mumbai</div>\n<div><strong>Nearest Rail station:</strong>&nbsp;The nearest train station is Kalyan (85KM).</div>', '::1', '2018-07-21 22:38:06', '2018-08-21'),
(27, 'Anonymous', 'support@techtravellers.com', 'GOA', '<div>Goa the party capital of India is one of the best places to visit during Monsoon. If you are a party lover and want to feel the vibrant life of Goa, then Monsoon might not be the best time for you. During the monsoon, the crowded beaches of Goa transform into calm heaven. You can get the whole beach for yourself. Just sit along on the beach and listen to the raindrops playing with the waves of the Arabian sea.&nbsp;</div>\r\n<div>Goa&rsquo;s wildlife sanctuaries are open around the year and you can visit the Mollem National Park and Cotigao Wildlife Sanctuary during this time. Bondha has a mini zoo and deer safari park where you can spend some time with your family and friends. The acclaimed spice plantation around Ponda is another popular place you can plan to visit.</div>\r\n<div>The Dudhsagar falls, located in the Mollem National Park is at its best during the Monsoon and this is a lifetime view which you must watch if you are traveling in Monsoon.</div>\r\n<div>An evening boat cruise in&nbsp; Mandovi river is a memorable event you must try in evening. Goa&rsquo;s Historical character-filled buildings provide a much interest to the traveler. You can also wander around the Fontainhas Latin Quarter and soak up the atmosphere or visit old restored Portuguese Mansions.&nbsp;</div>\r\n<div>One thing is sure that Goa has its own culture, own rhythm and own beauty, one shouldn\'t choose the place for its happening lifestyle.&nbsp;</div>\r\n<div><strong>How to reach Goa:</strong></div>\r\n<div>Nearest Airport is Goa International Airport, also known as the Dabolim airport,</div>\r\n<div>Our recommendation to travel Mumbai to Goa via train with Konkan railway or a&nbsp; road trip&nbsp; to witness the beauty of a western part of India</div>\r\n<div>You can choose any of the commutes from Bangalore or Mangalore as well.</div>', '::1', '2018-07-21 22:41:12', '2018-03-21'),
(28, 'Anonymous', 'support@techtravellers.com', 'Ashtamudi Kerala', '<div>When you are talking about the season of green, the first state will come to your mind is Kerala, God&rsquo;s Own Country. Kerala has a lot to offer in the Monsoon and Ashtamudi is one of them. It\'s a small town situated in the 70 km north west of Thiruvananthapuram. The town is famous and even got its name for its octopus-shaped lake which is actually the gateway of backwaters in Kerala.&nbsp; This area is renowned for leisure travel and for those looking for a scenic standalone getaway. Ashtamudi offers a less complicated and extensive but more cut off backwater experience.</div>\n<div>The season is also perfect for an Ayurvedic&nbsp; Treatment or an oil massage with a view of Kerala backwaters and Ashtamudi is one of the best choices for it. Spend a few days in leisure, forget about the worry of the concrete world. Go for a long walk, visit the Maharaja&rsquo;s palace at the valley, go to Alumkadavu to experience boat building or you can visit the Kollam town. So Ashtamudi is one of the perfect destinations for Monsoon Travel.&nbsp;</div>\n<div>So what are you waiting for...Plan and experience the untouched backwater beauty of God&rsquo;s own country. If you need any information regarding this place, please drop us a mail support@techtravellers.com</div>\n<div><strong>Access Information:</strong></div>\n<div>Nearest Airport -Trivandrum (75 kms), Cochin (Ernakulam) (160 kms), Tuticorin (206 kms)</div>\n<div>Nearest Railway Station - Kollam (12 kms), Varkala (44 kms), Trivandrum (75 kms)</div>', '::1', '2018-07-21 22:43:25', '2018-06-21'),
(30, 'Doyal Chowdhury', 'doyal09@gmail.com', 'Gorkhey Trek', '<p>If time travelling was real, me and my friends would have gone back in time to relive the moments spent about a month back. Obviously, we never get to relive them. We create new ones.</p>\n<p>&nbsp;</p>\n<p>The thirst for our next trip started from the moment our train screeched to a halt at Sealdah station. Our WhatsApp group -&nbsp; as we now a days have for each occasion - was renamed \"Where next?\"</p>\n<p>Let me tell you most of my friends are mountain-lovers.</p>\n<p>&nbsp;</p>\n<p>This time the only priority was we wanted a short trip to somewhere close to nature away from the regular hustle that we usually go through. In my imagination, where I could see or even feel the clouds, when I open the window.</p>\n<p>&nbsp;</p>\n<p>It was through this discussion that we ended up knowing about a small hamlet - Gorkhey - from one of our friends who had been there before. This small village is at the border of Darjeeling and Sikkim and you have to take the route via NJP itself.</p>\n<p>&nbsp;</p>\n<p>A group of 12 agreed to go, tickets were booked, package confirmed, bags were packed and we were ready on our quest to a new destination. Since we had very little time to plan, we could only get bus tickets to and from Siliguri. An 11 hours journey, not quite comfortable, so would suggest to go via train. Our plan was to start on Thursday and get back early morning to Kolkata on Monday.</p>\n<p>&nbsp;</p>\n<p>We reached Siliguri on Friday and as part of the package which included homestay, food and transport, our car was waiting for us to take us to Bhareng. We had booked a 13 seater car. We went from Siliguri to Jorethang, a 2 and a half hours&rsquo; journey and had lunch. I think it is worth mentioning that you would not get tower at Gorkhey (it is good to be cut off at times, for me it was a pros). So, make any phone calls you wish to at this point. Also, Gorkhey is a hilly wet region. If you are travelling during the rainy season like us, carrying salt is essential, since there is about 99% chance that you would encounter a leech.</p>\n<p>&nbsp;</p>\n<p>Going further up from Jorethang, we travelled for about 2 hours (more or less) through lush green mountains to reach Bhareng at around 3.30 - 4. The most interesting part of the trip starts from here. The trek to Gorkhey.</p>\n<p>&nbsp;</p>\n<p>Yes, a trek and it is quite nice and I would consider it to be quite challenging as well for a first timer. You have to trek for around 1 and half hours through the mountainous roads.&nbsp; It being the rainy season, we crossed quite a few streams on our way to the place. We loved the journey. The misty forest, the smell of wet ground and leaves, the faint sound of a river, I knew we were at the right place.</p>\n<p>&nbsp;</p>\n<p>We finally reached our cottage at around 5.30-ish. It was picture perfect!</p>\n<p>The cottage was right in the lap of the mountains. The river which gave us company from almost the beginning of our trek was now right at the foot of the mountain we had reached and its sound even louder. It probably might have rained in the morning and so we could feel a slight chill in the air. We were all dead tired still happy to have made it. To add on to this pleasure our hosts served us with Egg Wai-Wai. Trust me, it was the best wai-wai I had ever had.</p>\n<p>&nbsp;</p>\n<p>The cottage had provision for bonfire. In its warmth we felt content, witnessing the clouds embracing the mountains and the reflection of the moon in the river. There were no flashy lights, no blaring horns, no one rushing on his way to some place. I felt peace, I felt overwhelmed with what nature had to provide, and craved for more.</p>\n<p>&nbsp;</p>\n<p>Saturday morning was beautiful with a bright sunny weather. We went down to the river. We managed to be a child again, and got drenched. The water was chilly almost to the point when we couldn\'t feel our feet. We got back to our rooms, freshened up, had lunch and started for another village Samandin. This was also a small trek and was situated at a nearby hill. It started raining, but I felt it looked even more beautiful.</p>\n<p>&nbsp;</p>\n<p>Sunday morning by the time I went to the porch outside it had stopped raining and I was greeted by an unknown beautiful bird. I remembered my friend mentioning the place to be the Singalila National Park. If you are lucky enough you might catch a glimpse of endangered birds and animals. I felt the rains (that woke me up) to be symbolic as we all were sad to leave the place. It was love at first sight for us. I knew I would miss the fresh air, the sound of the river, the simplicity of our hosts. I knew life would happen to us again, but the memories would stay on forever.</p>\n<p>&nbsp;</p>\n<p>We almost pulled each other to get ready so that we don&rsquo;t miss our bus back to Kolkata, only with the promise of planning our next trip soon.</p>', '187.177.141.132', '2018-07-22 11:47:52', '2018-04-22'),
(31, 'TechTravellers Team', 'support@techtravellers.com', 'List of beautiful tourist places in Murshidabad', '<p><strong>There are lots of tourist places within Murshidabad which are:</strong></p>\n<ul>\n<li>Hazarduari Palace</li>\n<li>Bara Imambara</li>\n<li>Jafarganj&nbsp;Cemetery</li>\n<li>Khosbag</li>\n<li>Katra Masjid</li>\n<li>Moti jheel</li>\n<li>Nasipur Palace</li>\n<li>Kathgola Bagan</li>\n<li>New Palace/Wasif Ali Mazil</li>\n<li>Cossimbazar Rajbari</li>\n<li>Duch&nbsp;Cemetery</li>\n<li>Footi Mosque</li>\n</ul>\n<p>Lets talk about&nbsp;</p>\n<p><strong>Hazarduari Palace: </strong></p>\n<p>The <strong>Hazarduari</strong> Palace, or the palace built with thousand doors is one of the major tourist attractions of Murshidabad. The palace was once the position for holding the &lsquo;Durbar&rsquo; or meetings of the <strong>Nawabs</strong>. The Hazarduari Palace was built during the rule of the <strong>Nawab Nasib Humayun Jah</strong> in 1837 by the architect Duncan Macleod and given the name <strong>Nizamat Quila or </strong><strong>Nizamat Kila. </strong><strong>Now it is renamed as</strong> <strong>Hazarduari</strong></p>\n<p>Tourists from all over the world gather each year to escape the present and get a glimpse of the Nawabi lifestyle. The name<strong> &ldquo;Hazarduari</strong>&rdquo; roughly translates to \'a thousand doors\' as this palace is embellished with a thousand ornamental gateways. Out of these, 900 doors are real, and the rest are false doors which were built to confuse any intruders. The construction style of the palace is an mixture of Italian and Greek architectural styles and is a great example of Murshidabad\'s rich cultural heritage. The total area of Hazarduari Palace is 41 acres. Bhagirathi River flowing by the side of the palace enhances beauty to its surrounding landscape.</p>\n<p>At present day Hazarduari Palace has been converted into a museum. This museum contains collections of Dutch paintings, arms and weapons, bronze and marble statues, costumes, jewellery, palanquins, carriages, farmans, rare books, old maps, manuscripts, land revenue records and palanquins mostly belonging to eighteenth and nineteenth centuries and various other objects of gold, silver and ivory ranging from Siraj-ud-Daula\'s prized swords to the vintage cars owned by the Nawabs.</p>\n<p>There is a&nbsp;<strong>Clock</strong> <strong>Tower</strong>&nbsp;between Hazarduari and Imambara. It was built by Sagar Mistri, assistant of Duncan Macleod. At the top of the tower is a big heavy sounding bell. Located between Hazarduri and Imambara is the&nbsp;<strong>Bachchawali</strong> <strong>Toop</strong>. The barrel is 11&prime;6&Prime; long, with a girth in the middle of 7&prime;9&Prime;. Made between 12th and 14th centuries, it weighs 7657 kg. Look out for brass inlay lines and designs on the cannon.</p>\n<p>Hazarduari Palace was handed over to the Archaeological Survey of India in the year 1985 for better restoration.</p>\n<p><strong>Few key notes of those who are interested in visiting Hazarduari Palace:</strong></p>\n<ul>\n<li>Closed on Friday,</li>\n<li>Ticket cost is Rs. 10 for Indians and rs. 100 for foreign nationals(May changed according time)</li>\n<li>Visited between 9am and 5pm.</li>\n<li>Photography within museum prohibited.</li>\n</ul>\n<p><strong>How to reach?</strong></p>\n<p>Suitable way is take a train from Kolkata or Sealdah station to Murshidabad (MBB). You will find battery cars (#TukTuk) outside of Murshidabad Station to reach Hazarduari. They will take 10/- per head.Or you can take another option as a Tanga.</p>', '139.5.231.248', '2018-07-22 15:04:18', '2018-01-22'),
(32, 'Anonymous', 'support@techtravellers.com', 'Koro Hills Gangdua and Amarkanan', '<p><strong>Koro Hills</strong> is situated in the middle of <strong>Bankura district</strong>. It is a quite non-popular tourist attraction in West Bengal. Compare to other hills in Bankura, Koro is like a teenager. It is only 400ft high. There is an Ashram just below the hill. The dress name is <strong>Uttamashram</strong>, the nickname <strong>Tapoban</strong>. It seems like that it is original <strong>Tapoban</strong> from Book. Around the fruit and the flowering trees, a quiet, relaxed atmosphere. On the one side, there is a shelter of cattle, while on the other hand the place for the temporal(<strong>Ashraamik</strong>). This is the address of a <strong>Nischintapur</strong> beyond the city\'s racket. The local administration has cut the steps of the hill and made a well-arranged staircase. There are hundreds of steps like this here. There is also a place to take a rest after the stairs take place. The whole mountain covered with different trees. A <strong>Sabitri Temple</strong> is situated on the top. There are innumerable texts on the walls of the temple complex. If you look around the mountains, surrounded by the lovely, creepy, waves of greenery. On the side of the little <strong>Shali River</strong> passes, its curtains are not less interesting.</p>\n<p>Going to <strong>Gangdua Dam</strong>. The distance of Gangdua from Koro Hills is four kilometers. Although the reservoir on the river Shali is small in size, the formation of the reservoir is not less in any part of it. The size of the reservoir lock gate is limited to about 50 feet. But in the enchanting surroundings of the surroundings, the sky in the decorated forest, the row of eucalyptus trees, the wind blows into a strange silence. This reservoir was constructed several decades ago by digging several hundred hectares of land. Originally it was created to distribute water for irrigation purposes. It is seen far away from the obscure figure of the <strong>Susunia</strong> mountain.</p>\n<p>Here is the <strong>Ramakrishna Seva Dol Ashram</strong>, which is also known as <strong>Amarkanan Ashram</strong>, which is designed by <strong>Govindaprasad Singh</strong> and initiating the path of Gandhiji. Netaji was here to organize of the freedom struggle. <strong>Qazi Nazrul Islam\'s</strong> song was named \"<strong>Amar Amarkanan</strong>\" in the name of this village. This village is surrounded by jungle, is called \"Santiniketan of Bankura\".</p>\n<p><strong>How to Reach:</strong> Going to Bankura town on the train from <strong>Howrah</strong>(<strong>Kolkata</strong>), then take a bus to go the <strong>Gangajalghanti</strong> bus stand which will take you in front of the Koro Hill. <br />Also, you can go from Durgapur or Raniganj to the Gangajalghanti or Amarkanan by bus to reach Koro Hills. Its distance from Bankura is not more than 20 kilometers.</p>\n<p><strong>Where to stay:</strong> The forest Bungalow of Bankura Forest Department (North), Ramkrishna Sebadal Ashram Guest House and Mandir Guest House are there to stay. <br />To book the forest Bungalow, you can contact or get in touch with the DFO of the Northern Division. </p>\n<p><strong>Here are the details:</strong><br /><strong>DFO&nbsp;</strong>- North Division, Bankura<br /><strong>Pincode&nbsp;</strong>- 722101</p>\n<p><strong>Qazi Narul Islam :</strong></p>\n<p>&ldquo;à¦…à¦®à¦° à¦•à¦¾à¦¨à¦¨<br />à¦®à§‹à¦¦à§‡à¦° à¦…à¦®à¦°-à¦•à¦¾à¦¨à¦¨!<br />à¦¬à¦¨ à¦•à§‡ à¦¬à¦²à§‡ à¦°à§‡ à¦­à¦¾à¦‡, à¦†à¦®à¦¾à¦¦à§‡à¦° à¦¤à¦ªà§‹à¦¬à¦¨,<br />à¦†à¦®à¦¾à¦¦à§‡à¦° à¦¤à¦ªà§‹à¦¬à¦¨à¥¤<br />à¦à¦° à¦¦à¦•à§à¦·à¦¿à¦£à§‡ &lsquo;à¦¶à¦¾à¦²à§€&rsquo; à¦¨à¦¦à§€ à¦•à§à¦²à§à¦•à§à¦²à§ à¦¬à§Ÿ,<br />à¦¤à¦¾à¦° à¦•à§‚à¦²à§‡ à¦•à§‚à¦²à§‡ à¦¶à¦¾à¦²à¦¬à§€à¦¥à¦¿ à¦«à§à¦²à§‡ à¦«à§à¦²à¦®à§Ÿ,<br />à¦¹à§‡à¦¥à¦¾ à¦­à§‡à¦¸à§‡ à¦†à¦¸à§‡ à¦œà¦²à§‡-à¦­à§‡à¦œà¦¾ à¦¦à¦–à¦¿à¦¨à¦¾ à¦®à¦²à§Ÿ,<br />à¦¹à§‡à¦¥à¦¾ à¦®à¦¹à§à§Ÿà¦¾à¦° à¦®à¦‰ à¦–à§‡à§Ÿà§‡ à¦®à¦¨ à¦‰à¦šà¦¾à¦Ÿà¦¨à¥¤&rdquo;</p>', '203.163.235.19', '2018-07-24 01:44:27', '2018-01-24'),
(33, 'Priya Roy', 'support@techtravellers.com', 'Kanak Durga Temple A tourist place to visit in Jhargram', '<p><strong>Kanak Durga Temple</strong> is situated in <strong>Jhargram District</strong>. <strong>Golden Durga Pratima</strong>, At a distance of <strong>12 Kms</strong> from <strong>Jhargram</strong>. Between the <strong>Chilkigarh</strong> <strong>Raj Palace</strong> and <strong>Kanak Durga Temple</strong> flows the <strong>Dulung</strong> river. The <strong>Kanak Durga</strong> Temple lies in the south direction. The Main attraction of <strong>Chilkigarh</strong> is the <strong>Kanak Durga Temple</strong>. The temple is covered in the west by a dense forest, in the east by <strong>Dulung</strong> river. The forest is covered with a medicinal plant of 433 types. These plants draw attention from different places for research. From Bihar and Jharkhand <strong>Jambani</strong> may be called <strong>\'Gateway of Bengal\'</strong>. In <strong>Chilkigarh</strong> there grows a mixed culture of Bengal <strong>Jharkhand</strong> and <strong>Orissa</strong>. <br />Local management has already taken a few steps to develop eco-tourism like boat riding, airy park for children and guest house adjacent to the main temple. A typical species of monkeys live in the temple premises. There are many butterflies, swans, peacocks etc. which run free in the temple area and the forest.<br />Folklore speaks of a king <strong>Jagatdeo</strong> who came here from <strong>Madhya Pradesh</strong>. He defeated the local reigning king <strong>Dhabaldeb</strong> for making his rule more acceptable to the indigenous inhabitants of the place and married the queen of <strong>Dhabaldeb</strong>.<br />The folklore speaks of a dream that a later king <strong>Gopinath</strong>, possibly a descendant of <strong>Jagatdeo</strong> had. In his dream, Devi asked the king to build a temple for her. The store idol which used to be housed in the temple is now covered in gold.</p>', '115.96.131.6', '2018-07-26 00:49:37', '2018-01-26'),
(34, 'anonymous ', 'anonymous@techtravellers.com', 'Worlds Deadliest Mountains', '<p>Everest is always the most searched keyword when it comes to the mountains especially Himalaya. But you will be surprised to know that the great Mount Everest might be the highest in the world but not the deadliest. There are other mountain picks which have more death ratio than everest.</p>\n<p>Kangchenjunga (8586 mtr) situated in the Indo-Nepal border is worlds third highest mountain and also the part of the great Himalaya. Which has been summited by 187 climbers as of now where a total of 40 climbers died during the journey with a ratio of 22%.</p>\n<p>Nanga Parvat (8126 mtr): the killer mountain of Pakistan is also coming in the list of deadly mountains to climb. 23% of all successful summits to the mountain pick have been accompanied by a death. This Pakistani giant killed 31 climbers before the first full ascent at 1953. Going by the hight the Nanga Parvat comes in the 9th tallest mountain of the world. But the hight alone isnt the reason of its leathality, the brutal weather is one of the key reason why the climbers face death very often.</p>\n<p>K2 (8611 mtr ):When you are talking about lethality then you can not forget the name K2. This is the second tallest and second lethal mountain of the world. 24% of the climbers who tried this expedition couldn\'t make it to back to home. K2 also known as Mount Godwin Austin, is situated in&nbsp; the karakoram mountain range with a elevation of 8611 meter and technically the toughest point to climb in planet earth. Less than 400 people in history have completed the trip up K2. That&rsquo;s only a small fraction of the 7500 that have scaled Everest.</p>\n<p>Annapurna (8091 mtr): situtaed in the Gandaki zone, Nepal which has a&nbsp;summit-to-death ratio of nearly one in three. That bone-chilling figure can be explained in one word: avalanches. This mountain range is often being covered in new snow, which causes the avalanches. This is the reason why you have to be lucky to reach the mountain peak. The everest is the populer peak to climb &nbsp;in the elite mountain club but the hard climbers always know the hard truth. Everest can be the highest but the Annapurna peak is the deadliest among all.</p>\n<p>&nbsp;</p>', '45.123.14.245', '2018-07-27 23:09:47', '2018-04-27'),
