INSERT INTO `blog_details` (`blog_id`, `name`, `email`, `title`, `story`, `ipaddress`, `datetime`, `date`) VALUES
(37, 'TechTravellers Team', 'sayan.dutta@techtravellers.com', 'Cleanest Village of Asia Mawlynnong', '<p><strong>Meghalaya&rsquo;s Mawlynnong:</strong></p>\r\n<p><strong>H</strong>i,&nbsp;All Welcome to&nbsp;<strong>Mawlynnong</strong>&nbsp;in Meghalaya, The cleanest village in Asia nominated in 2003. A journalist from&nbsp;<strong>Discover Magazine</strong>&nbsp;visited this village in Meghalaya and was so impressed with what he saw that he dubbed it &lsquo;<strong>Asia&rsquo;s Cleanest Village</strong>&rsquo;. If you are in Meghalaya make sure you should not miss to trek Mawphlang.</p>\r\n<p>This village is 78.2&nbsp;km via NH206 from Shillong. The village is located in the East Khasi Hills district of Meghalaya. Here you can enjoy with the rich wildness of nature like living roots bridge which is very interesting to me, fresh air, discover a cave and pretty waterfalls, and get a glimpse of Bangladesh to form a tower. There are too many things to do.</p>\r\n<p>Village community over there who takes care of maintaining their village CLEAN, BEAUTIFUL and GREEN. A strict ban on plastic and tobacco and unique methods of garbage disposal have ensured by a community.</p>\r\n<p>By the way they are much more innovative to manage waste material. Recyclable wastage such as leaves are buried and used as fertilizer. Other wastage is driven far away from the village and burned. Ban materials such as plastic, which is toxic when burned, is reused in the form of planters and swings. The village has also eliminated open excretion with the presence of toilets in each of its households.</p>\r\n<p>In recent times, villagers have complained of increased noise pollution and lack of privacy&nbsp;because of the large number of tourists who visit the village. However, Mawlynnong remains Asia&rsquo;s cleanest village till date. The village has become an inspiration for other villages.</p>\r\n<p>My request is to all of you to keep all the tourist place clean and pollution free.</p>\r\n<p><strong>Best time to visit:</strong>&nbsp;OCT-APR</p>', '115.96.154.90', '2018-07-28 15:38:18', '2018-07-28'),
(46, 'Animesh Ghosh', 'animesh.ghosh@techtravellers.com', 'Kabini The Forest of Bagheera', '   <p>While the other forests and wild life reservs are closed in the monsoon, the jungle of kabini is open for the entire year. Infact you can visit Kabini in monsoon because this time of the year you can spot the Tiger, Leopard, Elephant, Wild Dogs and ofcourse the eye cacthing Peacock dance. The sighting of shadowing black panther at Kabini forest makes it one of the hotest destination for the wildlife photographers.&nbsp;Birdwatchers come to Kabini forest reserve in droves, some armed with powerful cameras, as they try to identify and record the various bird species that call this place home. Over 350 species of birds have been identified around this pristine riverine landscape. Some of the birds that can be viewed around the lake include grey-headed fish eagles and ospreys. Great cormorants nest on the dry stumps of trees. During guided nature walks you can come across some of the more inland species like the Malabar Lark, Malabar trogon, Indian Pitta and the glorious Malabar pied hornbill.</p>\r\n<p><strong>Where is Kabini:</strong> Kabini is the river that flows in southern part of Nagarhole National park, which divides Nagarhole and Bandipur National Parks, Karnataka, India. The Section of Nagarhole Forest that is adjoining this river is famously known as Kabini Forest. The park ranges the foothills of the Western Ghats spreading down the Brahmagiri hills and south towards Kerala state.</p>\r\n<p><strong>Safari at Kabini:</strong> There is no better way to immerse oneself in the wilderness than a wildlife safari. Safaris are conducted twice a day in Kabini, as you enter the forests on designated routes. Early morning safaris are the best time to witness most of the animals of the reserve, who step out for water and food before the temperatures rise. Evening safaris are considered a good time to spot the spots, i.e. the leopards that rule this corner of Nagarhole.&nbsp;</p>\r\n<p>&nbsp;<strong>How to reach:</strong>&nbsp;One of the advantages of Kabini is that for such a wild place, it boasts great connectivity. The forest reserve is only 80 kms away from Mysore and 230 kms away from Bangalore.&nbsp;The nearest domestic airport is in Mysore, 62 kms away via the State Highway 33 and the nearest international airport is in Bangalore 250 kms away, a four and a half hours journey via the NH275.&nbsp;The nearest railway station is Mysore junction, 62 kms away.</p>\r\n<p>&nbsp;</p>\r\n<p>Photographer: Praveen Siddannavar and information courtesy Karnataka tourism.</p>', '115.96.154.90', '2018-07-28 22:19:42', '2018-06-28'),
(47, 'TechTraveller Team', 'sayan.dutta@techtravellers.com', 'South 24 Parganas', '<p><strong>South 24 Parganas:</strong></p>\r\n<p><strong>S</strong>outh 24 Parganas has served as the capital of the kingdom of Raja Bikramaditya and later on, Pratapaditya. South 24 Parganas is a vital area of West Bengal, India as well as It is the sixth most populous district in INDIA. The region is famous for the delta area called the Sundarban, which is a traveller spot that witnesses individuals from everywhere throughout the world. And Sundarban which is mostly popular for its Royal Bengal Tiger that we all know.</p>\r\n<p>South 24 Parganas is situated on the south eastern area of West Bengal and has lots of waterways and bunch of islands. South 24 Parganas district comprises 5 subdivisions namely Alipore Sadar, Baruipur, Canning, Diamond Harbor, and Kakdwip. The region is known for its visitor destinations and wonderful climate. All the tourist spots like Port Canning, Behala, Kasba, Bhangar, Naruipur, Mathurapur &amp; Kultali are very well linked by street. A large number of guests group form all over the world enjoy the adventure of South 24 Paragans wildlife.</p>\r\n<p>Most famous spots in this area are:</p>\r\n<ul>\r\n<li>Sundarban,</li>\r\n<li>Ganga Sagar,</li>\r\n<li>Bakkhali,</li>\r\n<li>Henry&rsquo;s Iceland</li>\r\n<li>Jambudwip</li>\r\n<li>Ghoramara Island</li>\r\n<li>BAPS Shree Swaminarayan Mandir</li>\r\n</ul>', '139.5.228.189', '2018-07-29 12:11:13', '2018-07-29'),
(48, 'Amlan Ghosh', 'ghoshamlan.cse@gmail.com', 'Neora Valley National Park', '<p>The Neora Valley National Park, in Kalimpong district, West Bengal, is an immaculate forest beside one of the oldest river of India, Neora. The park reaches up to an elevation of 10600 ft at Rachela Danda, the highest point of Neora Valley National Park, which borders Sikkim and Bhutan. This park is spread over an area of 88 km&sup2;.</p>\r\n<p>Nature is so elegant in this part of eastern Himalayan. This place will offer you one of the dense forests; even sunlight finds it difficult to touch the ground.</p>\r\n<p>This place is a land of some the Threatened Species like Red Panda, Himalayan Thar, Himalayan Black, Indian Leopard, Musk Deer. In the winter this place is paradise for bird watchers; many rare birds are found in this park like Hodgson&rsquo;s hawk cuckoo, mountain hawk eagle, and mountain imperial pigeon.</p>\r\n<p>Once you are there you can stay at &lsquo;Kolakham Eco Huts&rsquo; or you can stay at camp. You can go trekking, village tour, visit the local monastery visit &lsquo;Chaggey waterfalls&rsquo;. Local people in this area are very much helpful and hospitality of them is very good.</p>\r\n<p>You can also enjoy many snow peaks, the never-ending green forest and majestic view of Kanchenjunga, the world third highest peak, and spellbound with natural beauty. Places like Lava, Charcole is near Kolakham can be visited.</p>\r\n<p><strong>How to Reach:</strong></p>\r\n<p>This place is 123 km from New Jalpaiguri Railway Station. You need to book four wheels to reach.</p>\r\n<p>OR you can go from &lsquo;Bagdogra Airport&rsquo; which is 117 km from this place.</p>\r\n<p><strong>Nearest Airport:</strong> Bagdogra Airport.</p>\r\n<p><strong>Nearest Rail station:</strong> New Jalpaiguri Railway Station.</p>', '202.142.115.40', '2018-07-29 19:16:41', '2018-03-05'),
(50, 'Sreetama Deb', 'sreetamacognizant@gmail.com', 'The Ajanta Caves of Maharastra', '<div>The ancient&nbsp;<strong>Ajanta Caves</strong>&nbsp;near&nbsp;<strong>Aurangabad</strong>&nbsp;are some of the oldest rock-cut&nbsp;<strong>Buddhist</strong>&nbsp;cave monuments standing firm, withstanding nature and time itself. The caves are said to be built from the&nbsp;<strong>2nd century BCE to 480 CE</strong>&nbsp;and the same currently falls within the&nbsp;<strong>Aurangabad</strong>district of&nbsp;<strong>Maharashtra, India.</strong>&nbsp;The caves have protected ancient paintings and rock cut sculptures that are considered among the finest surviving examples of ancient Indian art and history.</div>\r\n<div>To reach the caves we started from the city of&nbsp;<strong>Aurangabad</strong>&nbsp;by car, one can also take public buses from the nearby bus terminus to reach a huge parking area at the foot of the&nbsp;<strong>Ajanta hills</strong>. One must leave their own vehicles here and board government-run green buses from this point onwards towards the caves. Once the buses reached the bus parking area we got down and started walking towards the cave on foot and although the walk was quite long it was worth every drop of sweat that we shed on the way. The paintings inside the caves were astonishing. In some of the main caves, the paintings covered the entire cave walls and ceilings leaving only the floors bare. One can only imagine how much time and effort have been spent to paint each and every corner of these caves with vibrant organic colors mixed from plants and flowers that have withstood centuries. It is a privilege to stand and witness these masterpieces. The painting mostly depicts the past lives and rebirths of Buddha and tales from&nbsp;<strong>Jatakamala</strong>. Apart from painting the caves also have huge worship halls with equally huge rock sculptures of Buddha in his different poses. Once you enter the caves and the worship halls you will truly know what absolute peace feels like.</div>\r\n<div>It is a shame that the paintings in some of the most important caves have been damaged beyond repair and the rest are now conserved by&nbsp;<strong>UNESCO</strong>&nbsp;with utmost care. The Ajanta caves have been named as a world heritage site and should be a must visit place in every traveler\'s list as only if you come you will witness the beauty of history and storytelling through the eyes of ancient monks and will leave with an awestruck mind and a peaceful heart.</div>', '115.96.154.90', '2018-07-29 23:00:17', '2018-07-29'),
