(54, 'Sreetama Deb', 'sreetamacognizant@gmail.com', 'Ooty The gem of the Nilgiris Tamilnadu', '<div>Ooty, the name itself gives us the serene vision of cool blue hills, green plantations and old Bollywood songs and why not, it is one of those famous hill stations whose name we have heard the most as we grew up. Although there are many more beautiful hill stations that have now come up as happening places to visit, the old charm of Ooty will always attract travelers to the Nilgiris time and again.</div>\r\n<div>Ooty or Udagamandalam is a cozy little town situated in the Nilgiris district of Tamil Nadu. We started our journey towards Ooty from Chennai central bus terminus as it is well connected by roads from both Chennai and Bengaluru. We travelled overnight and reached Ooty in the morning at around 10 o clock. The cool temperatures all throughout the day and the town inviting setting amidst the lush green hills has rightfully earned Ooty the moniker Queen of the Hills. On one side Ooty will calm your senses with its lush green tea plantations, sparkling lakes and a backdrop of the Nillgiris while on the other side it will tickle the historian in you with its quaint bunglows and heritage buildings that reflect Ooty colonial past. While in Ooty the places that one must visit are the Government Rose garden that houses 20,000 varieties of roses, the Ooty lake which is a popular picnic spot and the Ooty Botanical Gardens amongst the few.</div>\r\n<div>While in Ooty take a toy train ride, go boating or embark on a tea plantation tour to know more about the most loved beverage of our country. Once in the plantations do not forget to taste the tea prepared in the little stalls from the tea leaves plucked from the same garden or collect the flavored tea mixes prepared by the local tea houses as a take away. Also do not leave Ooty without tasting the assortment of homemade chocolates, sold by their weight in little shops in the market place and trust me when I say they taste HEAVENLY. If you are an adventurous soul visit the mystical and spooky forests where the Bollywood movie Raaz was shot for some spine tingling experiences.</div>\r\n<div>So what are you waiting for, pack your bags and leave all your worries behind to recharge your batteries in the peace and serenity offered by this hill escape. While there do not forget to load your lungs with fresh air, belly with chocolates and heart with the beauty and thrills offered by this cozy little town in the heart of the Nilgiris.</div>', '45.123.14.245', '2018-08-03 01:16:55', '2018-08-03'),
(55, 'TechTravellers Team', 'sayan.dutta@techtravellers.com', 'World Largest Mangrove Forest and The Land of Royal Bengal Tiger', '<p><strong>Sundarban</strong> is the largest connecting mangrove forest (140,000 ha) in the world. Whose 60% of property is in Bangladesh and rest of it in INDIA. Bangladesh part covers three wildlife sanctuaries:</p>\r\n<ul>\r\n<li>Sundarban West Wildlife Sanctuary</li>\r\n<li>Sundarban South Wildlife Sanctuary</li>\r\n<li>Sundarban East Wildlife Sanctuary</li>\r\n</ul>\r\n<p>All of them formed as a Sundarbans Reserved Forest.Sundarban flora is characterised by the plenty&rsquo;s of&nbsp;sundari,&nbsp;gewa,&nbsp;goran&nbsp;and keora all of which occur prominently throughout the area. Due to this specific environment you can find several of wildlife&nbsp;species, birds and reptiles, including&nbsp;Bengal tiger,&nbsp;chital,&nbsp;crocodile,&nbsp;snakes&nbsp;many of which are considered rare.. But in the 20th century ecological quality of the forest is declining day by day due to many reasons.</p>\r\n<p>Still this area has silent charm that manages to keep the simplicity and naturalness of its ecological balance in spite of offering habitat to some of the most dynamic and awe-inspiring flora and fauna. Population surveys of Royal Bengal Tigers estimate a population of between 400 to 450 individuals, a higher density than any other population of tigers in the world.</p>\r\n<p>It is a declared as Tiger Reserve, home to the Royal Bengal Tiger- an almost extinct species who swim in the saline water and are often <strong>man</strong>-<strong>eaters</strong> varieties.&nbsp;Tiger attacks are frequent in the Sundarbans. Between 0 and 50 people are killed each year.</p>', '47.15.222.47', '2018-08-05 14:54:01', '2018-08-05'),
