(58, 'Arnab Majumder', 'arnabmajumderkol@gmail.com', 'Bodh Gaya The Most Holy Place for Buddhist', '<p><strong>Bodh Gaya</strong>, the holiest place for Buddhist and also it is the most important of the main four pilgrimage site of <strong>Gautama Buddha</strong>(Other three: <strong>Kushinagar</strong>, <strong>Lumbini</strong>, and <strong>Sarnath</strong>). <strong>Bodh Gaya</strong> is situated with <strong>Mahabodhi Temple Complex</strong> in <strong>Gaya District</strong>, Bihar, India. Since 2002, Mahabodhi temple located in Bodh Gaya is <strong>UNESCO</strong> World Heritage site.</p>\r\n<p>It is the place where Gautama Buddha gained enlightenment under a Banyan Tree, later known as Bodhi Tree. There are meditation ground and lotus ponds inside the Mahabodhi temple complex. Earlier this place was known as Uruwela, it is situated by the bank of river Niranjana. King Asoka built the temple here for the first time.</p>\r\n<p>The history of Bodh Gaya is documented by many inscriptions and pilgrimage accounts. Foremost among these are the accounts of the Chinese pilgrims <strong>Faxian</strong> in the 5th century and <strong>Xuanzang</strong> in the 7th century. The area was at the heart of a Buddhist civilization for centuries, until it was conquered by Turkic armies in the 13th century. Historically, it was known as <strong>Uruvela, Sambodhi, Vajrasana </strong>or<strong> Mahabodhi</strong>. The main monastery of Bodh Gaya used to be called the <strong>Bodhimanda-Vihara</strong> (Pali). Now it is called the <strong>Mahabodhi Temple</strong>.</p>\r\n<p>Every year millions of peoples have visited this place. The disciples of Gautama Buddha began to visit the place during the full moon in the month of <strong>Vaisakh</strong> (April&ndash;May), as per the Hindu calendar. The day of enlightenment became known as <strong>Buddha Purnima</strong>, place as Bodh Gaya and the tree as Bodhi Tree. Peoples from many other nations with a Buddhist tradition (Bhutan, Bangladesh, China, Japan, Myanmar, Sri Lanka, Thailand, Tibet) also visited this place. Also, other monasteries are there to visit.</p>\r\n<p><strong>How to Reach:</strong></p>\r\n<p><strong>By Air:</strong>&nbsp;Nearest airport is at Gaya(17 Kms). But this airport is not much active. Alternatively, people can reach from Patna Airport (110 km) also.</p>\r\n<p><strong>By Train:</strong> Nearest railway station is Gaya Junction. From there people can take Taxi, Auto(three wheelers) etc.<br /><br /><strong>By Car:</strong> Peoples are visited from Delhi, Kolkata, Patna by Car. Roads are good now but narrow.</p>\r\n<p><strong>By Bus:</strong> Multiple bus services are available from Patna, Kolkata , Varanasi etc.</p>\r\n<p><strong>Places to Visit: </strong></p>\r\n<ul>\r\n<li><strong>Bodhi Tree</strong></li>\r\n<li><strong>Mahabodhi Stupa</strong></li>\r\n<li><strong>Thai Monastery</strong></li>\r\n<li><strong>80-foot Buddha Statue</strong></li>\r\n<li><strong>Japanese temple</strong></li>\r\n<li><strong>Archaeological Museum</strong></li>\r\n<li><strong>Tergar Monastery</strong></li>\r\n<li><strong>Royal Bhutanese Monastery</strong></li>\r\n<li><strong>Barabar Caves</strong></li>\r\n</ul>\r\n<p><strong>Source:</strong> Wikipedia, Wikitravel, TripAdvisor</p>', '203.163.245.73', '2018-08-10 13:25:55', '2018-08-10'),
(61, 'Shreyo Chakraborty', 'shreyo.c@gmail.com', 'Majestic Rajasthan', '<p style=\"font-weight: 400;\">One fine morning as a part of our once-a-year outing plan, my parents decided to visit the majestic land of <strong>Rajasthan</strong>. So, we booked return flight tickets to Jaipur and made the plan to cover the major cities in a span of 7 days. We covered the entire tour on a road trip in a hired cab.</p>\r\n<p style=\"font-weight: 400;\">Our tour started with <strong>Jaipur</strong>. Upon reaching there we took a city cab (Uber as far I remember) and went to the house of one of my mom&rsquo;s friend where our stay was planned. That day we mostly took rest and roamed about in the city in the afternoon and went to the old market whose walls were painted in saffron color that gave Jaipur the name of pink city.</p>\r\n<p style=\"font-weight: 400;\">Next day our journey started with a visit to <strong>Amber Fort</strong>, where elephant safari is available to reach the fort from the base of the mountain. A perfect blend of Mughal and Hindu architecture, the fort is a stunning creation in red sandstone and white marble. The <strong>Maota Lake</strong> adds to its charm and offers visitors with crystal clear reflections of the fort. Next city was <strong>Udaipur</strong>, whose palace is by far the most beautiful I have seen in whole Rajasthan. Situated in the middle of <strong>Lake Pichola</strong> with the perfect backdrop of <strong>Aravalli Mountains</strong>.&nbsp;Built as a summer palace by the royal family of Udaipur, it has now been taken over by the Taj Group of Hotels. Sculpted marble columns, decorative gild moldings and, of course, a magical view has led to it being voted as one of the most romantic hotels in India and the world.</p>\r\n<p style=\"font-weight: 400;\">Our next destination was <strong>Jodhpur</strong> and along the way, we visited the famous fort of <strong>Chittorgarh</strong>. The Chittorgarh fort is guarded by not one but 7 robust gates situated on the incline of the hill. There are several famous structures in the fort viz. <strong>Vijay Stambh, Kalika Mata Temple</strong> and of course the <strong>Palace of Rani Padmini</strong>, the palace with the most controversial story that now has a movie dedicated to it. Overall, Chittorgarh fort is&nbsp;one of the most important historical places in India. It has seen several centuries of glory. There are so many stories that each part of the fort narrates. Whatever stories I had heard about the glory of the fort seemed well justified upon visiting. After visiting Chittor, we went ahead for Jodhpur and had our night stay there. Next day we went to the <strong>Umaid Bhawan Palace</strong>, one of the largest private residences in the world and can be best described as the perfect mix of Indian and Art Deco styles. With 347 rooms, the palace used to provide employment to more than 3000 people when the royal family was still in power.</p>\r\n<p style=\"font-weight: 400;\">After Jodhpur, we headed for <strong>Mount Abu</strong>, the only hill station in Rajasthan that gave us some respite from scorching heat of the desert. There on the hill, a few kilometers away was the Jain temples of Dilwara, which are considered the finest example of marble stone carvings in India. The temples are famous for their ornate marble architecture, particularly the intricate carving on the ceilings and the pillars. It is one of the most popular Jain pilgrimage sites in the world.</p>\r\n<p style=\"font-weight: 400;\">After Jodhpur came the most coveted and nostalgic place of Bengalis, <strong>Jaisalmer</strong> which had the <strong>&ldquo;Sonar Kella&rdquo;</strong> or fort made of gold. It also had the first glimpse of a true desert in form of Thar desert. After exploring the fort made of yellow sandstone and seeing <strong>&ldquo;Apu-r Ghor&rdquo;</strong>(Home of Apu), we went on a desert safari in the evening riding camels which was a fun experience. It&nbsp;evokes an amazing picture of the brilliance&nbsp;and the desolation of the desert. After seeing the sunset on the desert, we had another truly unique and wonderful experience, spending the night in the desert under a clear sky watching the night show of desert performers in front of a bonfire.</p>\r\n<p style=\"font-weight: 400;\">And thus our wonderful journey of Rajasthan came to an end leaving us with lots of blissful experiences and memories to cherish. It was truly a land of majestic forts and mysterious deserts.</p>', '187.177.141.132', '2018-08-12 00:48:44', '2018-08-12'),
(62, 'TechTraveller Team', 'sayan.dutta@techtravellers.com', 'Gangasagar', '<p><strong>Ganga Sagar:</strong></p>\r\n<p>Gangasagar or Sagar island is&nbsp; one of the famous Hindu pilgrimage. Gangasagar is a place where ganga meets the ocean Bay of Bangal. Every pilgrim come to this place to take a dip in Ganga and purify their sole.Mostly you can find the population at the time of &ldquo;Makar Sankranti&rdquo;(14<sup>th</sup> Jan).</p>\r\n<p>Kapilmuni Temple-the main attraction of Gangasagar apart from the sea. This is the centre place of Gangasagar fair and pilgrimage held annually in the month of January.</p>\r\n<p>A day trip can easily be done from Kolkata or visit to Gangasagar can be clubbed with Bakkhali visit.</p>\r\n<p>Helicopter service is also available apart from bus, train and private car. Helicopter service only work in Sunday, encourage by State Govt.</p>\r\n<p><strong>Best time to visit:</strong> January</p>\r\n<p><strong>How to reach:</strong></p>\r\n<p>Take bus or private car from Dimond/Esplanade harbour road to 90 km Harwood point near Kakdip. Harwood point Lot no. 8 ferry ghat where a ferry runs to Kachuberia at the north end of the island. From there you will find lots of buses/jeeps and other shared vehicles are there which goes to Sagar Island.</p>\r\n<p>By train: &nbsp;Sealdah to kakdwip ( Namkhana local). If you reached Namkhana Station then go to Namkhana Ferry Ghat After that follow same route by ferry and so on.</p>\r\n<p><strong>Places to visit:</strong> The Sagar Beach, Kamil Muni Temple, The Sagar Lighthouse, Bharat Seva Ashram, Onkarnath Temple. All the places are within 500 meters.</p>', '139.5.230.137', '2018-08-12 08:08:23', '2018-08-12');
