(65, 'TechTravellers Team', 'sayan.dutta@techtravellers.com', 'Bakkhali Frasergunj South 24 Paragana', '<p><strong>Bakkhali &amp; </strong><strong>Frasergunj, South 24 Paragana:</strong></p>\r\n<p><strong>Bakkhali is a </strong>seaside&nbsp;close to Namkhana in Kakdwip Subdivision of South 24 Paragana.You will get a very peacefull environment in Bakkhali.There is small town named as Frasergunj, 2 Km north of&nbsp;Bakkhali<strong>.</strong>&nbsp;Obtain this name from Sir <strong>Andrew Fraser</strong> who was a lieutenant Governor of Bengal in the early of 19<sup>th</sup> century, discover this place. Frasergunj is mainly used for the fishermen and their work. Fishing is the primary occupation of most of the people. The windmills in Frasergunj serve as a power generating location.</p>\r\n<p>Basically if you want to spend a one or two days in sea beach then bakkhali is good option. Also you will get very peaceful and clam environment with less crowed. This beach is full of Red Crab. During the evening, you can visit the small market near the sea beach and do shopping.</p>\r\n<p>If you need a short break from your regular life then come and visit this place. JJJ</p>\r\n<p><strong>Nearest Attraction places:</strong></p>\r\n<p>Bon Bibi Mondir (temple), crocodile project, deer park, Jambu Island and Henry\'s Island.</p>\r\n<p><strong>Best time to visit:</strong> Winter</p>\r\n<p><strong>How to Reach:</strong></p>\r\n<p><strong>Train: </strong>Sealdha to Namkhana &agrave; Take Toto/TukTuk station to Ferry ghat &agrave; Cross the river by boat&agrave; Again catch toto for bus or local cab service to reach Bakkhali.&nbsp; Easiest and cheapest route also time consuming.(4-5 hrs). It is better not to travel by train if you have family as train will be crowded.</p>\r\n<p><strong>Bus:</strong> You can get direct bus service from esplanade to Bakkhali (By WBSTC) or Diamond harbour to Bakkhali bus service.</p>\r\n<p>Also you can experience with private car service.</p>', '47.15.106.121', '2018-08-19 13:29:25', '2018-08-19');
